function Note(props) {
    console.log(props.notes)
  return (
    <div className="note">
        {props.notes.map(note =>{
        return (
        <div>
        <h1>{note.title}</h1>
        <p>{note.content}</p>
        </div>
        )})}

      <button>DELETE</button>
    </div>
  );
}

export default Note;
